import React from "react";

function List({ todo, handleModify }) {
  console.log(`여기요 ${todo}`);
  return (
    <>
      {
        todo.map((x, idx) => 
         <li>

          {x.text}{x.status}
         </li>
        )
      }

    </>
  );
}

export default List;
